import React from "react";
import {TouchableOpacity, Text, StyleSheet, TouchableOpacityProps, View} from 'react-native'

interface ISkillCaraProps extends TouchableOpacityProps {
    Codigo: string,
    Pais: string,

}

export function SkillCard({Codigo, Pais, ...rest}: ISkillCaraProps){
    return (
        <View
            style={styles.buttonSkill} 
            
        >
        <View style={styles.infoPais}>
           <Text style={styles.textCodigo}>
            {Codigo}
            </Text>
            <Text style={styles.textPais}>
            {Pais}
            </Text>
        </View>

            <TouchableOpacity 
            {...rest} >
                <Text style={styles.textCodigo}>
                    Remover País
                </Text>
                
            </TouchableOpacity>
            
       </View>

        
       
        
    )
}
const styles = StyleSheet.create({
    buttonSkill: {

        
        alignItems: 'center',
        marginBottom: 15,
    },
    textCodigo: {
        color: '#fff',
        fontSize: 30,
        fontWeight: 'bold'
    },
    textPais: {
        color: '#fff',
        fontSize: 22,
        fontWeight: 'bold'
    },
    infoPais: {
        backgroundColor: '#ffffff81',
        borderRadius:15,
        padding:15
    }
})
